import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './profile.css';

import {Button, Form, Col, Row} from 'react-bootstrap';
// import {Info} from 'react-bootstrap-icons';

const InvestorForm = ()=>{
     return(
          <div className='form shadow'>
               <h3 className="profile-head">Registration form for Investors</h3>
               <Form>

               <Form.Group controlId="Investorname">
               <Form.Label>Name of Investor</Form.Label>
               <Form.Control className='form-input' type="text" placeholder="Enter Startup's name" />
               </Form.Group>
               </Form>
          </div>
     )
}

export default InvestorForm;
